import React, { useState } from "react";
import axios from "axios";
import XMLParser from "react-xml-parser";
import { useForm } from "react-hook-form";
import { CircularProgress } from "@material-ui/core";
import "./styles.css";
import ResultList from "./components/ResultList";

function App() {
  async function parseStr(dataSet) {
    const dataArr = new XMLParser().parseFromString(dataSet).children;
    console.log(dataArr);
    resultCount = dataArr.length; // 검색된 데이터의 수를 구한다. (dataArr length 에서 5개 값이 빠짐)
    console.log(resultCount);
    if (resultCount < 5) {
      alert("검색결과가 없습니다."); // 검색결과가 없을경우 알람표시
      setPrint(false);
      setLoaded(false);
    }
    setState((preState) => {
      return {
        ...preState,
        results: dataArr.slice(resultNumber, resultCount - 1),
      };
    });
    setLoaded(false);
    setPrint(true);
    // console.log(state.results); //state.result == servs
  }

  async function getAPI() {
